import { React, useState } from 'react';
import Logo from '../../Assets/Logo/Logo.jsx';
const Header = () => {
    return (
        <header className="Header">
            <div className="LogoContainer">
                <img src={Logo.logo} alt="VUA Logo" className="HeaderLogo" />
            </div>
            <div className="SearchInpitContainer">
                <input type="text" className="SearchInput" placeholder="Tìm Kiếm sản phẩm" >
                </input>
            </div>
            <div className="LogContainer">
                <button className="LoginButton">Đăng Nhập</button>
                <button className="RegisterButton">Đăng Ký</button>

            </div>
            <div className="BalanceContainer">
                <button className="BalanceButtom"> Số Dư : 0 đ </button>
            </div>


        </header>
    );

}
export default Header;
